import React from 'react';

function Levels() {
    var newButtons = [];
    for (var i=0; i<100; i++) {
        newButtons.push(<button type="button">{i}</button>);
    }
    return (
        <div>
            {newButtons}
        </div>
    );
}

export default Levels;
